import styled from 'styled-components';

const StyledMain = styled.main`
  color: red;
  font-size: 25rem;
  flex: 1;
  overflow: auto;
`;
const Title = styled.h1`
  color: red;
`;

const Main = () => (
  <StyledMain>
    <Title>asd</Title>
  </StyledMain>
);

export default Main;
